package org.alnx.leetcode.easy;

import java.util.HashMap;

public class ValidAnagram {
    static class Solution {

        public static void main(String[] args) {
            printCheck("foobar", "barfoo");
            printCheck("asdf", "df");
            printCheck("", "");
            printCheck(" ", " ");
            checkHuge();
        }

        public static boolean isAnagram(String s, String t) {
            if (s.length() != t.length()) {
                return false;
            }
            // s is an anagram of t if and only if:
            // -- all of t's characters occur in s
            // -- with the same count as they do in s

            // easy approach:
            // construct histogram of characters for string s, t
            // check they're the same
            // - iterate over all keys in s, check same as t

            var histS = new HashMap<Character, Integer>();
            var histT = new HashMap<Character, Integer>();

            for (Character c: s.toCharArray()) {
                histS.put(c, histS.getOrDefault(c,0) + 1);
            }
            for (Character c: t.toCharArray()) {
                histT.put(c, histT.getOrDefault(c,0) + 1);
            }

            // compare histograms
            if (histS.size() != histT.size()) {
                return false;
            }
            for (var e: histS.entrySet()) {
                if (!histT.containsKey(e.getKey())) {
                    return false;
                }
                if (!histT.get(e.getKey()).equals(e.getValue())) {
                    return false;
                }
            }
            return true;
        }
        private static void printCheck(String s, String t) {
            var res = isAnagram(s,t);
            System.out.printf("%s?%s: %s%n", s, t, res);
        }

        private static void checkHuge() {
            String s1 = "";
            String s2 = "";
            printCheck(s1,s2);
        }
    }
}
